import React from "react";

import Logo from "../component/logo";

import '../scss/header.scss'

class Header extends React.Component {
    constructor(props) {
        super(props);
        this.state={}
    }
    render() {
        return (
            <div>
                <header>
                    <Logo />
                </header>
            </div>
        )
    }
}
export default Header;
